      <p>Site criado com o intuito de ver, quantos cliques você consegue dar, até se cansar!</p>
      <br/>
      <p>Quando estiver pronto(a), é só começar a clicar no quadrado marrom, logo abaixo! Boa sorte!</p>

      <Counter />
    </div>
  );
}

